import React from "react";
import './tours.css'

export default function Tours(props){
    return(
        <div className="header">
             <h1 id="text">Our Tours</h1>
             <div>
                {
                    props.tours.map((tour) => {
                        [id,name,image,info,price] = tour;
                        return

                    })
                }
             </div>

        </div>
       
    )
}
